// import logo from './logo.svg';
import './App.css';
import './navbar.css';
import './Container';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Container>
        <Navbar expand="lg" variant="light" bg="light">
          <Container>
            <Navbar.Brand href="#">Navbar</Navbar.Brand>
          </Container>
        </Navbar>
      </Container>
        <h1>Hello World!</h1>
      </header>
    </div>
  );
}

export default App;
